description:
Battle for Terra (2007) Alternatieve titel: Terra 

Verenigde Staten
Animatie / Avontuur
85 minuten

geregisseerd door Aristomenis Tsirbas
met de stemmen van Evan Rachel Wood, Brian Cox en Chris Evans

Een buitenaards wezen is geobsedeerd door een object aan de hemel. Hij zal moeten beslissen wat belangrijker is: zijn eigen veiligheid of zijn nieuwsgierigheid om tot onderzoek over te gaan naar wat het object eigenlijk is.

